    return(
        <section className="image mt-4 col-sm-6 col-lg-3">
        <div> 
        <a href="" className="image__link">
          <img src={product.image} className="image__style"/>
        </a>
        <p className="image_title">(product.name)</p>
      </div>
        </section>
    )
}
